import { http } from "../plugins/http/http";

export const authServices = ({ email, password }) => ({
  login: async () => {
    await http
      .post("/login", { email, password })
      .then((user) => {
        console.log("test kimo user", user);
      })
      .catch((err) => console.error(err));
  },
});
